column28:
№7322 – уникальный номер помещения.

Аренда помещения от собственника (без комиссии); 

Арендные каникулы, скидки и индивидуальные улучшения - все обсуждается;

Помещение находится на огороженной и охраняемой территории;

Назначение: Склад;

Транспортная доступность: Каширское ш., Липецкая ш.; 

Технические характеристики:

Площадь в аренду: 30096 м2; 
 Возможна нарезка частями;
Температурный режим: Теплый; 
 Этаж: 3; 
 Высота потолка: 7.5 м; 
 Промышленные ворота: доковые ворота,пандус,грузовой лифт; 
 Пандус: 1; 
 Кран-балка: 1; 
 Пол: Бетон-антипыль; 

Коммерческие условия:

Арендная ставка: 15 500 руб/м.кв/год с НДС; 

✆ ✆ ✆

Есть другие варианты площадей (в том числе в соседних районах).
 Звоните!

